Universal Battery Cable
Spool 20 Foot Black 10 Gauge Lightning cable is half the weight of standard battery cable Copper Clad aluminum allows maximum energy transfer The ACCEL battery cable is available in 4, 2, and 10 gauge cable and is half the weight of traditional battery cable. The copper clad aluminum design allows your racecar to have the same amount of energy and power running thru your battery cables but at half the weight. This allows you to lighten up your car or add weight were it will help the car handle better, such as relocating the battery to the trunk. The wire is available in 20 and 100 foot spools to re-wire one or several racecars. Easy to use compression fittings and terminals simply twist and screw on. Red and black heat shrink tubing kits available to put a professional looking finish on the terminal ends available in 4 packs. Pre made 3 foot long grounding cables available in 4 and 2 gauge.nbsp;
